console.log("login");const r=document.getElementById("login-email"),a=document.getElementById("login-password");document.getElementById("login-button");const t=document.getElementById("login-form");t==null||t.addEventListener("submit",l=>{l.preventDefault();const s=r.value,c=a.value,n=JSON.stringify({email:s,password:c});console.log(n),fetch("http://localhost:3000/auth/login",{method:"POST",headers:{"Content-Type":"application/json"},body:n}).then(e=>{if(console.log(e),!e.ok)throw new Error("Network response was not ok");return e.text()}).then(e=>{console.log(e);const o=JSON.parse(e);console.log(o),o.error?alert(o.error):(localStorage.setItem("accessToken",o.accessToken),localStorage.setItem("refreshToken",o.refreshToken),window.location.href="/index.html")}).catch(e=>{console.log(e)})});
